import { useEffect, useRef } from 'react'
import gsap from 'gsap-trial'
import DrawSVGPlugin from 'gsap-trial/DrawSVGPlugin'
import LogoS from '../../../assets/images/logo-s.png'
import './index.scss'

const Logo = () => {
  const bgRef = useRef()
  const outlineLogoRef = useRef()
  const solidLogoRef = useRef()
  const drawnYet = useRef(false)

  useEffect(() => {
    if (drawnYet.current) {
        return
    }
    drawnYet.current = true
    gsap.registerPlugin(DrawSVGPlugin)

    gsap
      .timeline()
      .to(bgRef.current, {
        duration: 1,
        opacity: 1,
      })
      .from(outlineLogoRef.current, {
        drawSVG: 0,
        duration: 20,
      })

  }, [])

  return (
    <div className="logo-container" ref={bgRef}>
      <img
        className="solid-logo"
        ref={solidLogoRef}
        src={LogoS}
        alt="JavaScript,  Developer"
      />

      <svg
        width="559pt"
        height="897pt"
        version="1.0"
        viewBox="0 0 559 897"
        xmlns="http://www.w3.org/2000/svg"
      >
        <g
          className="svg-container"
          transform="translate(0 457) scale(.1 -.1)"
          fill="none"
        >
          <path
            ref={outlineLogoRef}
            d="M40 10.95v800m370-800h-80m140 40v800M180 270.474l210 580.475m-290 .001h80m210 0h80m-79.746-800h80M180 850.95V270.475M390 630V50.95m0 0-60-40m80 0 60 40m-430 760 60 40m290.258-.002-60.254-39.616m-.004-.382L180 397.307M100 50.95v800m80-800L390 630M330 10.95v449.948M100 50.95h80m-60-40 60 40m-140-40 60 40m-60-40h80"
            />
        </g>
      </svg>
    </div>
  )
}

export default Logo
